import React, { useEffect, useState } from 'react';
import axios from 'axios'
import {Link} from 'react-router-dom'
function Cars() {
    const [carmaodel,setcarmodel] = useState([])
    useEffect(()=>{
        axios.get('http://localhost:8081/')
        .then(res=>setcarmodel(res.data))
        .catch(err=>console.log("Error"));
    },[])

    const handleDelete = async(id)=>{
        try{
            await axios.delete(`http://localhost:8081/rmcar/${id}`)
            window.location.reload()
        }catch(err){
            console.log("Error");
        }
    }

    return (
        <>
        <div>Codel</div>
        <Link to ='/create' className =" btn btn-success">Add</Link>
        <table className="table">
        <thead>
            <tr>
            <th scope="col">Id</th>
            <th scope="col">Model</th>
            <th scope="col">Type</th>
            <th>Action</th>
            </tr>
        </thead>
        <tbody>
            {
                carmaodel.map((data,i)=>(
                    <tr key={i}>
                        <td>{data.id}</td>
                        <td>{data.name}</td>
                        <td>{data.type}</td>
                        <td><Link to={`/update/${data.id}`}className='btn btn-primary'>Update</Link>
                            <button className='btn btn-danger' onClick={ e=> handleDelete(data.id)}>Delete</button>
                        </td>
                    </tr>
                ))
            }
        </tbody>
        </table>
        </>
    );
}

export default Cars;
